style.css:
@-moz-document domain("youtube.com") {
.html5-play-progress, .ytp-play-progress
  {
    background: #44BFE7 !important;
  }

  .ytp-progress-bar-container .ytp-scrubber-button {
      content: url(https://static.wikia.nocookie.net/catchteeniepin/images/5/5f/Trustping_render_1.png);
      width: 30px;
      height: auto;
      margin-top: -6px;
      margin-left: -5px;
      background-color: transparent;
      transform: scale(1);
    }

  .html5-progress-bar-container, .ytp-progress-bar-container
  {
    height: 12px !important;
  }

  .html5-progress-bar, .ytp-progress-bar
  {
    margin-top: 12px !important;
  }

  .html5-progress-list, .ytp-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list, .video-ads .ytp-progress-list.ytp-ad-progress-list
  {
    height: 12px !important;
  }

  .ytp-volume-slider-track
  {
    background: #44bfe7 !important;
  }

ytd-app
  {
    background: url(https://static.wikia.nocookie.net/catchteeniepin/images/2/27/Trustping_in_S2_intro.PNG)fixed #000!important;
    background-size: cover!important;
  }

  ytd-masthead
  {
    background: #3ebde7;
  }

  #guide-content.ytd-app
  {
    background: #3ebde7;
  }

  .load-more-button
  {
    background: 1px solid #44bfe7!important;
  }

  [role="alert"],.content-region,.yt-uix-checkbox-on-off .checked:before
  {
    display: solid!important;
    color: #44bfe7!important
  }

  :not(#​) :link
  {
    color: #44bfe7!important;
  }

  :not(#​) :visited
  {
    color: #44bfe7!important;
  }

  :not(#​) select
  {
    background: black!important;
  }

  .yt-uix-form-input-select,[class$="container"],#yt-comments-paginator
  {
    background-image: none!important;
  }

  :not(h2):not(button):not(.comment-simplebox-renderer-collapsed-content),#footer-container button,.yt-uix-button-shelf-slider-pager
  {
    box-shadow: none!important;
  }

#logo-icon
  {
    content: url("https://static.wikia.nocookie.net/parody/images/2/21/Trustping_png_1.png") !important;
    width: 85px;
    height: 50px;
    object-fit: cover;
  }

  ytd-topbar-logo-renderer
  {
    width: 0%;
  }
}
